import React from "react";
import myImage from "../img/myImage.png";

class WorkExperience extends React.Component {
  constructor() {
    super();
    this.state = {
      skills: [
        {
          id: "ReactJS_skill",
          content: "ReactJS",
          porcentage: "80%",
          value: "80"
        },
        {
          id: "ReactNative_skill",
          content: "ReactNative",
          porcentage: "80%",
          value: "80"
        },
        {
          id: "Python_skill",
          content: "Python",
          porcentage: "80%",
          value: "80"
        },
        {
          id: "JavaScript_skill",
          content: "JavaScript",
          porcentage: "80%",
          value: "80"
        },
        { id: "HTML5_skill", content: "HTML5", porcentage: "80%", value: "80" },
        { id: "CSS3_skill", content: "CSS3", porcentage: "75%", value: "75" },
        {
          id: "Express",
          content: "Express",
          porcentage: "70%",
          value: "70"
        },
        {
          id: "Node_JS",
          content: "NodeJS",
          porcentage: "60%",
          value: "60"
        },
        {
          id: "Mongo",
          content: "Mongo",
          porcentage: "60%",
          value: "60"
        },
        {
          id: "Swift",
          content: "Swift",
          porcentage: "25%",
          value: "25"
        }
      ],
      about_me: [
        {
          id: "first-p-about",
          content:
            "I'm a rising sophomore at Yale double majoring in Computer Science/Economics and Statistics."
        },
        {
          id: "second-p-about",
          content:
            "Interests: Reading, running, watching Youtube, and watching films. Some of my favorite films are Dark Knight, Casa Blance, and Jurassic Park"
        },
        {
          id: "third-p-about",
          content:
            "Extracurriculars: Vice President of Yale Computer Society, Logistics Chair of Yhack, Treasurer of Dwight Hall Socially Responsible Investment Fund, Stars I"
        },
        {
          id: "fourth p-about",
          content:
            "Extracurriculars: Vice President of Yale Computer Society, Logistics Chair of Yhack, Treasurer of Dwight Hall Socially Responsible Investment Fund, Stars I"
        }
      ],
      work_experience: [
        {
          role:"Hello",
          id: "first-p-about",
          content:
            "I'm a rising sophomore at Yale double majoring in Computer Science/Economics and Statistics."
        },
        {
          role:"Hello",
          id: "second-p-about",
          content:
            "Interests: Reading, running, watching Youtube, and watching films. Some of my favorite films are Dark Knight, Casa Blance, and Jurassic Park"
        },
        {
          role:"Hello",
          id: "third-p-about",
          content:
            "Extracurriculars: Vice President of Yale Computer Society, Logistics Chair of Yhack, Treasurer of Dwight Hall Socially Responsible Investment Fund, Stars I"
        },
        {
          role:"Hello",
          id: "fourth p-about",
          content:
            "Extracurriculars: Vice President of Yale Computer Society, Logistics Chair of Yhack, Treasurer of Dwight Hall Socially Responsible Investment Fund, Stars I"
        }
      ]
    };
  }

  render() {
    return (
      <section id="about" className="about-mf sect-pt4 route">
        <div className="container">
          <div className="row">
            <div className="col-sm-12">
              <div className="box-shadow-full">
                <div className="row">
                  <div className="col-md-6">
                    <div className="row">
                      <div
                        className="col-sm-6 col-md-5"
                        style={{ margin: "0 auto" }}
                      >
                        <div
                          className="about-img"
                          style={{ textAlign: "center" }}
                        >
                          <img
                            className="img-fluid rounded b-shadow-a"
                            alt=""
                          />
                        </div>
                      </div>
                    </div>
                    <div className="skill-mf">
                      {/* <p className="title-s">Skill</p> */}

                    </div>
                  </div>
                  <div className="col-md-6">
                    <div className="about-me pt-4 pt-md-0">
                      <div className="title-box-2">
                        <h5 className="title-left">Work Experience</h5>
                      </div>
                      {this.state.work_experience.map(content => {
                        return (
                          <div>
                            <h6>{content.role}</h6>
                            <p className="lead" key={content.id}>
                              {content.content}
                            </p>
                          </div>
                        );
                      })}
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    );
  }
}

export default WorkExperience;
